






CREATE OR REPLACE VIEW foodview AS
SELECT f.*, n.cant, m.name AS measure, m.sigla, n.calories, n.proteins, n.carbohidrates, n.fat, n.cholesterol, n.measureId,
c.name AS categoryName FROM foods f LEFT JOIN nutrients n on f.nutrientId=n.id LEFT JOIN measures m on n.measureId=m.id
LEFT JOIN categories c ON f.categoryId=c.id